package main

import "fmt"

func productExceptSelfIdeal(nums []int) []int {

	n := len(nums)
	res := make([]int, n)
	for i := range res {
		res[i] = 1
	}

	prefix := 1
	for i := 0; i < n; i++ {
		res[i] = prefix
		prefix *= nums[i]
	}

	fmt.Printf("res = %v \n\n", res)

	postfix := 1
	for i := n - 1; i >= 0; i-- {
		res[i] *= postfix
		postfix *= nums[i]
	}

	//fmt.Printf("res = %v \n\n", res)

	return res
}

